import React from "react";
import { Divider } from "primereact/divider";

const Header = (props) => {
  //console.log(props.a[0]);
  return (
    <div>
      Users:{props.userCount} Posts:{props.postCount} Albums:{props.albumsCount}{" "}
      Comments:{props.commentsCount}
    </div>
  );
};

export default Header;
